import org.example.Items;
import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

public class ItemsTest {

    Items item = new Items("ddsdsd","dsqdqsd");
    Items item1 = new Items("ddsdsd","");

    Items item2 = new Items("ddsdsd",null);
    @Test
    public void TestOfcontenuIsValid () {
        Assertions.assertTrue(item.contenuIsValid());
        Assertions.assertFalse(item1.contenuIsValid());
        Assertions.assertFalse(item2.contenuIsValid());
    }

}
